// src/components/AboutMe.js
import React from 'react';
import './AboutMe.css'; // Import the CSS file for styling

const AboutMe = () => {
    return (
        <section className="AboutMe">
            <h2 className="AboutMe-title">About Me</h2>
            <p className="AboutMe-content">
                Hi, I'm Zeeshan Javaid, a passionate software developer with expertise in web and mobile applications.
                I have a strong background in creating innovative solutions and have worked on a variety of projects
                that demonstrate my skills in both front-end and back-end development. I am always eager to learn
                new technologies and improve my craft. Feel free to connect with me to discuss potential projects or collaborations!
            </p>
        </section>
    );
};

export default AboutMe;
